const userId = '';
const username = '';
const email = 'test_email';
var share;
var save;
var shared;
var binData;
var disk;
var friends;
var userInfo;

export default{
    userId,
    username,
    email,    //用户邮箱
    share,       // 分享文件的信息
    save,
    shared,
    binData,
    disk,
    friends,
    userInfo
}
